<g id="What does it mean to you when something is &#226;&#128;&#156;readily available&#226;&#128;&#157;? What is your opinion of &#226;&#128;&#156;Ready to Eat&#226;&#128;&#157; foods? Is most of your clothing &#226;&#128;&#156;ready to wear&#226;&#128;&#157;? I&#226;&#128;&#153;m folding clothing at home when I begin to think about construction. The seams and joinery of the cloth falls apart, and the form begins to unfold in my mind&#226;&#128;&#153;s eye. As I learn about pattern-making in clothing, I learn that the act of standardization in mass production is an ART in the crafts-sense of the the word and was largely defined by hand-produced garment shaping. Many tout the luxury of wearing clothing tailored to one&#39;s body, but there&#39;s a certain EASE to throwing on a shirt a size larger than what you normally wear ... one can self-accentuate their body&#226;&#128;&#153;s FORM with clothing a size down, men wearing women&#226;&#128;&#153;s clothing constitute a form of art only just proliferating into the greater world, etc. A richness of expression is derived from readily available clothing a size away from you, or never made with you in mind. &#226;&#128;&#156;Throwing on&#226;&#128;&#157; clothing (&#226;&#128;&#156;Ease&#226;&#128;&#157;) is an action afforded by the standardization of clothing production, the action of making what was once costly to produce and custom &#226;&#128;&#156;ready to wear&#226;&#128;&#157;.">
